// import axios from "axios"
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Currency from "./Currency";

const CurrencyRate = () => {

  const [data, setData] = useState([]); // حالة لتخزين البيانات

  useEffect(() => {
    // استدعاء الـ API وجلب البيانات
    axios.get('https://example.com/api/data') // استبدل الرابط برابط API الخاص بك
      .then(response => {
        setData(response.data); // تخزين البيانات في الحالة
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []); // [] تضمن تشغيل الآثار فقط عند تحميل المكون

  

  return (


    <div>
    <h1>API Data</h1>
    <ul>
      {data.map(item => (
        <li key={item.id}>{item.name}</li>
      ))}
    </ul>
  </div>
  )
}

export default CurrencyRate
